import React from "react";

const HomePage =()=>{

    return(
        /*Css grid parts  */
        <div className="wrapper">
        <h1>Product</h1>
          <div className="col"><h3>col 1</h3></div>
          <div className="col"><h3>col 2</h3></div>
          <div className="col"><h3>col 3</h3></div>
          <div className="col"><h3>col 4</h3></div>
          <div className="col"><h3>col 5</h3></div>
          <div className="col"><h3>col 6</h3></div>
          <div className="col"><h3>col 7</h3></div>

        </div>
    )
}

export default HomePage;
